import { Grid } from '@material-ui/core';
import React from 'react';

function Result() {
	return (
		<Grid item container justify="space-around">
			<Grid item container xs="8">
				Equation
			</Grid>
			<Grid item container xs="4">
				Result
			</Grid>
		</Grid>
	);
}

export default Result;
